import statistics
def jaccard(seq0, seq1, ngram):
	set0 = set()
	set1 = set()
	for i in range(len(seq0)-ngram):
		set0.add(seq0[i:i+ngram])
	for i in range(len(seq1)-ngram):
		set1.add(seq1[i:i+ngram])

	return len(set0.intersection(set1))/len(set0.union(set1))


